import { Link } from "react-router-dom";

function MainNavigation() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/">홈</Link>
            <Link to="/product">프로덕트</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
